import React from 'react';
import '../style.css'
import {
    BrowserRouter,
    Switch,
    Route,
    Link,
    Redirect,
  } from "react-router-dom";
  import StockPanel from './StockPanel'
  import StockItem from './StockItem'
  import placeHolder from './images/racaogato.jpeg'




class RegisterScreen extends React.Component {

    render() {

        const items = [<StockItem imgSrc={placeHolder} name="Ração do Cão"  quantity='47'/>,
                       <StockItem imgSrc={placeHolder} name="Ração do Gato" quantity='62'/>,
                       <StockItem imgSrc={placeHolder} name="Ração do Rato" quantity='51'/>,]

        return (
            <Switch>
                  <Route exact path={this.props.match.path}>
                    <Redirect to={`${this.props.match.path}/servicos`}/>
                  </Route>
                  <Route path={`${this.props.match.path}/clientes`} component={StockPanel}/>
                  <Route path={`${this.props.match.path}/admins`} component={StockPanel}/>
                  <Route path={`${this.props.match.path}/produtos`} component={StockPanel}/>
                  <Route path={`${this.props.match.path}/servicos`} component={StockPanel}/>
                  {/*<Route path={`${this.props.match.path}/carrinho`} component={ShopCartScreen}/>
                  <Route path={`${this.props.match.path}/banho`} component={ShowerBookingScreen}/>
                  <Route path={`${this.props.match.path}/consulta`} component={AppointmentBookingScreen}/> */}
            </Switch>
        );
    }
}

export default RegisterScreen;
